import { useCalendar } from '../context/CalendarContext.js';

function WeekDetail() { 
  const { selectedWeek, people } = useCalendar(); 

  return (
    <div>
      {selectedWeek && <DayList people={people} />}
    </div>
  );
}

export default WeekDetail;
